import React from "react";
import TextField from "@material-ui/core";

const TextInput = (props) => {
    return (
        <TextField
            fullWidth={true}
            label={props.label}
            margin={"dense"}
            row={props.rows}
            value={props.value}
            type={props.type}
            onChange={props.onChange}
        />

    )

}

export default TextInput
